import React, { useState } from "react";
import Idioms from "./Idioms";

function Slider() {
  return (
    <div>
      <div className="container-slider">
        {Idioms.map((text, key) => (
          <span key={key} className="idioms">
            {`text.idioms${key + 1}`}
          </span>
        ))}
      </div>
    </div>
  );
}

export default Slider;
